int cross_method()
{
	int i, j, k, b, n1, ans = 0;
	double x[2], y[2];
	int gc[101];
	char mk[101];

	for (i = 0; i < n; i++) {
		gc[i] = 0, mk[i] = 0;
		for (j = i+1; j < n; j++) {
			n1 = intersect(c[i], c[j], x, y, x+1, y+1);
			gc[i] += n1;
			for (k = 0; k < n1; k++) {
				if (find_c(x[k], y[k], i+1, j-1) == -1 &&
					find_c(x[k], y[k], j+1, n-1) == -1) {
					mk[i] = 1;
					b = find_c(x[k], y[k], 0, i-1);
					if (b != -1) mk[b] = 1;
				}
			}
		}
	}

	ans = 0;
	for (i = 0; i < n; i++) {
		if (mk[i]) ans++;
		else if (!gc[i]) {
			for (j = i+1; j < n; j++) {
				if (include_circle(j, i))  break;
			}
			if (j >= n) ans++;
		}
	}
	return ans;
}
